contracts/MultiSigWallet.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.10;


contract MultiSigWallet{

    event Deposit(address,uint);
    event Submit();

    address[] public owners;
    uint private required;
    mapping(uint => mapping(address => bool)) public approval;

    struct Transaction{
        address to;
        uint value;
        bool executed;
    }

    Transaction[] public transactions;

    constructor(address[] memory _owners, uint _required) {
        for(uint i; i < _owners.length; i++){

        }
        required = _required;
    }

    modifier notApproved(uint _txId) {
        require(!approval[_txId][msg.sender],"Transaction Already Approved...");
        _;
    }

    modifier existTrans(uint _txId) {
        require(_txId <= owners.length - 1,"Transaction Does not Exist...");
        _;
    }


    receive() external payable{
        emit Deposit(msg.sender ,msg.value);
    }

    function makeTransaction(address _to, uint _value) external {
        transactions.push(Transaction(_to,_value,false));

    }

    function approveTransaction(uint _txId) external notApproved(_txId) existTrans(_txId) {

        
    }
}

